import {AppBar,Toolbar,styled} from '@mui/material';
import { NavLink } from 'react-router-dom';

const Header=styled(AppBar)
`
background: #111111;
`;

const Taps=styled(<NavLink/>)
`
font-size:20px;
font-weight:600;
margin-right: 30px;
`;

const Navbar=()=>{
    return (
       <Header position='satatic'>
        <Toolbar>
            <Taps>Home</Taps>
            <Taps>All User</Taps>
            <Taps>Add User</Taps>
        </Toolbar>
       </Header>
    )
}

export default Navbar;
